import re
zip_to_state = {'01000': 'Massachusetts', '10001': 'New York', '33100': 'Florida'}

def check_zip_code(zip_code):
    """"""
    pattern = '^\\d{5}$'
    if re.match(pattern, zip_code):
        state = zip_to_state.get(zip_code, 'Unknown')
        return state
    else:
        return 'Invalid zip code'
